import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Paper,
  Button,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import Header from '../components/Header';
import StudentList from '../components/StudentList';
import RegistrationModal from '../components/RegistrationModal';

const PublicPage: React.FC = () => {
  const [registrationModalOpen, setRegistrationModalOpen] = useState(false);
  const [refreshTrigger, setRefreshTrigger] = useState(0);
  const navigate = useNavigate();

  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const handleRegistrationClick = () => {
    setRegistrationModalOpen(true);
  };

  const handleAdminClick = () => {
    navigate('/login');
  };

  const handleRegistrationClose = () => {
    setRegistrationModalOpen(false);
  };

  const handleRegistrationSuccess = () => {
    setRegistrationModalOpen(false);
    setRefreshTrigger(prev => prev + 1);
  };

  return (
    <Box sx={{ 
      display: 'flex', 
      flexDirection: 'column', 
      minHeight: '100vh',
      backgroundColor: '#f5f5f5' // Fondo gris claro como en la imagen
    }}>
      {/* Header simplificado */}
      <Box 
        component="header" 
        sx={{ 
          backgroundColor: 'white',
          borderBottom: '1px solid #e0e0e0',
          py: 2,
          px: 3
        }}
      >
        <Container maxWidth="lg">
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
            <Typography 
              variant="h6" 
              component="div" 
              sx={{ 
                fontWeight: 700,
                color: '#333'
              }}
            >
              EduConnect
            </Typography>
            <Button
              variant="text"
              onClick={handleAdminClick}
              sx={{
                color: '#666',
                fontSize: '14px',
                textTransform: 'none',
                '&:hover': {
                  backgroundColor: '#f0f0f0'
                }
              }}
            >
              ¿Eres administrador o docente? Haz clic aquí
            </Button>
          </Box>
        </Container>
      </Box>

      {/* Main Content */}
      <Box component="main" sx={{ flexGrow: 1, py: 4 }}>
        <Container maxWidth="lg">
          {/* Título principal */}
          <Box sx={{ mb: 3 }}>
            <Typography 
              variant={isMobile ? 'h4' : 'h3'} 
              component="h1" 
              sx={{ 
                fontWeight: 700,
                color: '#333',
                mb: 1
              }}
            >
              Participantes del Curso
            </Typography>
            <Typography 
              variant="body1" 
              sx={{ 
                color: '#666',
                fontSize: '16px'
              }}
            >
              Conoce a los estudiantes inscritos en este curso online.
            </Typography>
          </Box>

          {/* Total de estudiantes y botón de registro */}
          <Paper 
            elevation={0}
            sx={{ 
              p: isMobile ? 2 : 3, 
              mb: 3,
              backgroundColor: 'white',
              border: '1px solid #e0e0e0',
              borderRadius: 2
            }}
          >
            <Box sx={{ mb: 3 }}>
              <Typography 
                variant="body2" 
                sx={{ 
                  color: '#666',
                  mb: 1,
                  fontSize: '14px'
                }}
              >
                Total de Estudiantes
              </Typography>
              <Typography 
                variant="h4" 
                sx={{ 
                  fontWeight: 700,
                  color: '#333'
                }}
              >
                10
              </Typography>
            </Box>

            <Button
              variant="contained"
              onClick={handleRegistrationClick}
              sx={{
                backgroundColor: '#2196F3', // Azul similar al de la imagen
                color: 'white',
                textTransform: 'none',
                fontSize: '14px',
                fontWeight: 500,
                py: 1.5,
                px: 3,
                borderRadius: 2,
                '&:hover': {
                  backgroundColor: '#1976D2'
                }
              }}
            >
              Registrarse como Estudiante
            </Button>
          </Paper>

          {/* Lista de estudiantes */}
          <Paper 
            elevation={0}
            sx={{ 
              p: isMobile ? 2 : 3,
              backgroundColor: 'white',
              border: '1px solid #e0e0e0',
              borderRadius: 2
            }}
          >
            <Typography 
              variant="h6" 
              sx={{ 
                fontWeight: 600,
                color: '#333',
                mb: 2
              }}
            >
              Lista de Participantes (10 estudiantes)
            </Typography>
            <StudentList refreshTrigger={refreshTrigger} showPagination={false} />
          </Paper>
        </Container>
      </Box>

      {/* Footer */}
      <Box 
        component="footer" 
        sx={{ 
          py: 2, 
          px: 2, 
          mt: 'auto',
          backgroundColor: 'white',
          borderTop: '1px solid #e0e0e0',
          textAlign: 'center'
        }}
      >
        <Typography 
          variant="body2" 
          sx={{ 
            color: '#999',
            fontSize: '12px'
          }}
        >
          © 2024 EduConnect. Todos los derechos reservados.
        </Typography>
      </Box>

      {/* Registration Modal */}
      <RegistrationModal
        open={registrationModalOpen}
        onClose={handleRegistrationClose}
        onSuccess={handleRegistrationSuccess}
      />
    </Box>
  );
};

export default PublicPage;
